import React from 'react'
import { Link, Route, Switch, useRouteMatch as Match } from 'react-router-dom';
import ShowPost from './pages/post';
export default function index() {
    const match = Match();
    return (
        <Switch>
            <Route path={match.url+'/add'}>
                <Link>
                home
                </Link>
            </Route>
            <Route path={match.url+'/'}>
                <ShowPost/>
            </Route>
        </Switch>
    )
}
